INSERT INTO `catalog_pages` VALUES ('1', '-1', '', ' Front Page', '213', '1', '1', '1', '0', '1', 'frontpage', 'catalog_frontpage_headline_shop_GENERAL', 'frontpage_teaser', ' ', '<i><b><font color=\"#0E668C\" size=\"16\">What can I find in the shop?</font></b></i><br><br>Upgrade your clothing with Habbo Club, adopt a pet or decorate your room the way you like it. Whatever you like to do most in Habbo, you\'ll find a way to make that experience even better by browsing our Shop.<br><br><li>Join <a href=\"event:catalog/open/habbo_club\">Habbo Club</a></li><li><a href=\"event:catalog/open/set_pixelnew\">Decorate </a>your room</li><li>Adopt a <a href=\"event:catalog/open/pet_horse\">Pet</a>, <a href=\"event:catalog/open/bots\">Bot</a> or <a href=\"event:catalog/open/monster_plant\">Monsterplants</a></li><li>Make your own <a href=\"event:catalog/open/category_wired\">Wired</a> games </li><br><i><b><font color=\"#0E668C\" size=\"16\">Where can I get credits?</font></b></i><br><br>Credits are given out every 15 Minutes! You can also get them by inviting other users, participating in events or gambling in our casinos!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('2', '-1', 'set_pixelnew', 'Furni By Theme', '196', '1', '0', '1', '0', '4', 'default_3x3', 'catalog_frontpage_headline2_en', '', ' ', '', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('3', '-1', '', 'Ducket Shop', '178', '1', '0', '1', '0', '9', 'default_3x3', 'catalog_frontpage_headline2_en', '', ' ', '', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('5', '-1', 'habbo_club', 'Buy Club', '172', '1', '1', '1', '0', '2', 'vip_buy', 'catalog_header_hc', 'hc_catalog_teaser', ' ', 'Habbo Club, purHabbo one of the three options', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('6', '5', '', 'Club Shop', '172', '1', '1', '1', '0', '3', 'default_3x3', 'catalog_header_hc', 'catalog_hc_teaser', ' ', 'We\'ve got all that exclusive club furniture available for you right here .. but for an exclusive price.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('11', '-1', '', 'Exchange', '146', '1', '1', '1', '0', '17', 'default_3x3', 'catalog_bank_headline1', 'catalog_bank_teaser', ' ', 'Habbo Exchange is where you can convert your Credits into a tradable currency. You can then use this currency to trade for Furni or just show off your riches in your room.', ' ', '', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('12', '-1', 'pet_horse', 'Pets Shop', '8', '1', '0', '1', '0', '12', 'default_3x3', 'Habbo_catalogue', '', ' ', '', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('13', '234', '', 'Spaces', '225', '1', '1', '1', '0', '16', 'spaces_new', 'look_feel_text', '', ' ', 'Floors, wallpapers, landscapes - get a groovy combination for your room! Use our sample room below to try before you buy. Select the design and color you like and blick buy.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('14', '-1', '', 'VIP Shop', '137', '0', '0', '2', '0', '20', 'default_3x3', 'catalog_header_VIP', 'catalog_licted_teaser', ' ', 'Welcome to the VIP Catalogue! Here you can buy rares according to your budget.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('15', '234', '', 'Windows', '218', '1', '1', '1', '0', '19', 'default_3x3', 'ctlg_windows_headline1_en', 'ctlg_windows_teaser1_en', ' ', 'Let some sunshine in! Our windows come in many styles to give a unique look to your room. Who said your room can\'t have a view?', ' ', '', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('16', '234', '', 'Mood Lights', '115', '1', '1', '1', '0', '10', 'default_3x3', 'catalog_dimmers_header_en', 'dimmers_teaser', ' ', 'Our range of moodlights allow you to control the atmosphere and transform your room in just a click. What will your room look like? Click the switch and find out now!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('17', '236', '', 'Christmas', '90', '1', '1', '1', '0', '2', 'default_3x3', 'catalog_xmas_headline1', 'xmas2009_catalogue', ' ', 'Get yourself into the Christmas spirit with our selection of festive furni! From baubles to Reindeer poo, we\'ve got it all!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('18', '236', '', 'Arctic', '13', '1', '1', '1', '0', '1', 'default_3x3', 'catalog_arc_header1_en', 'catalog_arc_teaser1_en', ' ', 'Stay cool (or warm with out campfire!) with and create your own Winter Wonderland or Humble Homeland for your Penguins.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('19', '234', '', 'Teleports', '120', '1', '1', '1', '0', '17', 'default_3x3', 'catalog_doors_headline1', 'catalog_door_a', ' ', 'Beam yourself from one room to another with our space age teleports. Buy a pair, put one in each room and you\'ve got your own suite! Teleports are sold in pairs(obviously!), so if your trade for them, check that your\'re getting a linked pair.', ' ', 'Click on an item for more details.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('20', '234', '', 'Mode', '39', '1', '1', '1', '0', '9', 'default_3x3', 'catalog_mode_headline1', 'catalog_mode_teaser1', ' ', 'Steely, grey industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('21', '234', '', 'Candy', '19', '1', '1', '1', '0', '4', 'default_3x3', 'catalog_candy_headline1', 'catalog_candy_teaser1', ' ', 'A bit more feminine than \'Mode\', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the \'Mode\' catagory!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('22', '234', '', 'Pura', '48', '1', '1', '1', '0', '13', 'default_3x3', 'catalog_pura_headline1', 'catalog_pura_teaser1', ' ', 'The clenest, freshest range. You can almost hear it breath cool and tranquility within your room. Use it to create a haven away from the hetic lifestyle of Habbo Hotel.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('23', '234', '', 'Area', '14', '1', '1', '1', '0', '2', 'default_3x3', 'catalog_area_headline1', 'catalog_area_teaser1', ' ', 'A chunky and sofisticated line for the down-to-earth, studious Habbo. It\'s simplicty is beautful and will add a welcoming charm to every room.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('24', '2', '', 'Country', '21', '1', '1', '1', '0', '16', 'default_3x3', 'country_header1_en_001', 'country_teaser1', ' ', 'Lets leave the busy city streets and head over to the wide abyss of golden whear, emerald fields and home grown, organic vegetables. Everything you need to create a farm!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('25', '234', '', 'Lodge', '37', '1', '1', '1', '0', '8', 'default_3x3', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', ' ', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('26', '234', '', 'Plastic', '46', '1', '1', '1', '0', '12', 'default_3x3', 'catalog_plasto_headline1', '', ' ', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('27', '234', '', 'Bathroom', '17', '1', '1', '1', '0', '3', 'default_3x3', 'catalog_bath_headline1', 'catalog_bath_teaser1', ' ', 'Lets face it.. you can\'t live without your bathroom. Give yours guests somewhere to freshen up with our cheeful bathroom collection!', ' ', 'Click on an item for more information.', ' ', '0', '', '');
INSERT INTO `catalog_pages` VALUES ('28', '234', '', 'Plants', '220', '1', '1', '1', '0', '11', 'default_3x3', 'catalog_plants_headline1', 'catalog_plants_teaser1', ' ', 'Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful rose or elegant fruit tree...', ' ', '', ' ', '0', '', '');
